let testState = createSlice({
  name: "testState",
  initialState: 0,
  reducers: {
    increase(state, action) {
      return state + action.payload;
    }
  }
}) // reducers 라는 값에 객체를 만들고 그 안에 원하는 이름의 값 변경 함수를 만들고 export

export let { increase } = testState.actions; // actions == stock 객체의 reducers가 참고하고 있는 객체
